import SingleCityCard from './components/SingleCityCard';
import './CityWeatherCard.css';

function CityWeatherCard(props) {
    const { data } = props;
    return (
        <div className="other-city-weather-card">
            <SingleCityCard city={data[0].city} weather={data[0].weather} minTemp={data[0].minTemp} maxTemp={data[0].maxTemp} />
            <SingleCityCard city={data[1].city} weather={data[1].weather} minTemp={data[1].minTemp} maxTemp={data[1].maxTemp} />
            <SingleCityCard city={data[2].city} weather={data[2].weather} minTemp={data[2].minTemp} maxTemp={data[2].maxTemp} />
            <SingleCityCard city={data[3].city} weather={data[3].weather} minTemp={data[3].minTemp} maxTemp={data[3].maxTemp} />
        </div>
    )
}

export default CityWeatherCard;
